import dynamic from "next/dynamic";
import { useEffect, useState } from "react";
import Popup from "reactjs-popup";
import Profile from "../components/profile";
import useWindowDimensions from "../hook/useWindowDimensions";
import ThreeCanvas from "../components/threeCanvas";
import {
    createBlog,
    getUserBySet,
    loadDiagram,
    loadDiagramName,
    saveBlog,
} from "../components/API";
import { compileAll } from "../block_system/systemObj";
const QuillNoSSRWrapper = dynamic(import("react-quill"), {
    ssr: false,
    loading: () => <p>Loading ...</p>,
});

const modules = {
    toolbar: [
        [{ header: "1" }, { header: "2" }, { font: [] }],
        [{ size: [] }],
        ["bold", "italic", "underline", "strike", "blockquote", { color: [] }],
        [
            { list: "ordered" },
            { list: "bullet" },
            { indent: "-1" },
            { indent: "+1" },
        ],
        ["link", "image", "video"],
    ],
    clipboard: {
        // toggle to add extra line breaks when pasting HTML:
        matchVisual: false,
    },
};
/*
 * Quill editor formats
 * See https://quilljs.com/docs/formats/
 */
const formats = [
    "header",
    "font",
    "size",
    "bold",
    "italic",
    "underline",
    "strike",
    "blockquote",
    "list",
    "bullet",
    "indent",
    "link",
    "image",
    "video",
    "color",
];

function editSection() {}

function QillObj(props) {
    // const [quillContent, setQuillContent] = useState("");
    const { page, setPage, id } = props;

    return (
        <>
            {" "}
            <QuillNoSSRWrapper
                modules={modules}
                formats={formats}
                value={page[id].value}
                onChange={(p) => {
                    console.log(page);
                    page[id].value = p;
                    setPage(page);
                }}
                theme="snow"
            />
        </>
    );
}
export default function BlogEdit({ user, setUser }) {
    const [sectionList, setSectionList] = useState([]);
    const [diagramCompList, setDiagramCompList] = useState([]);
    const [diagramList, setDiagramList] = useState([]);
    const [page, setPage] = useState([]);
    const [loadIndex, setLoadIndex] = useState(-1);
    const { height, width } = useWindowDimensions();
    const [blogId, setBlogId] = useState("");
    const defulatImg = getdefaultImg();
    function getdefaultImg() {
        return "data:image/png;base64,";
    }
    const [info, setInfo] = useState({
        name: "untitle",
        cover_image: defulatImg,
    });
    async function setDiagramNameList(user) {
        diagramCompList = [];
        console.log(user);
        diagramList = await loadDiagramName(user.email, user.password);
        // setDiagramName();
        console.log(diagramList);
        for (let i = 0; i < diagramList.length; i++) {
            diagramCompList.push(
                <button
                    className="load_diagram_items"
                    onClick={() => {
                        // setLoadItemIdx(i)
                        setLoadIndex(i);
                        // loadIndex = i;
                        console.log("done select " + i);
                    }}
                >
                    {diagramList[i].name}
                </button>
            );
        }
        setDiagramCompList(diagramCompList);
        setDiagramList(diagramList);
    }
    if (!user._id) {
        getUserBySet(setUser);
    }
    async function insertQill() {
        // setPage([...page, { type: "qill", value: quillContent }]);
        page = [...page, { type: "qill", value: {} }];
        setPage(page);
        // console.log([...page, { type: "qill", value: {} }]);
        console.log(page);
        setSectionList((prevSectionList) => [
            ...prevSectionList,
            <QillObj id={page.length - 1} setPage={setPage} page={page} />,
        ]);
    }
    async function insertComponent() {
        const tmp = await loadDiagram(
            user.email,
            user.password,
            diagramList[loadIndex].id
        );
        // elements = tmp.elements;
        const system = compileAll(tmp.elements);
        setPage([
            ...page,
            { type: "elements", value: diagramList[loadIndex].id },
        ]);
        setSectionList((prevSectionList) => [
            ...prevSectionList,
            <ThreeCanvas
                width={Math.floor(0.5 * width)}
                height={0.5 * width}
                system={system}
                isRun={1}
            />,
        ]);
    }
    const [reset, setReset] = useState(0);
    useEffect(() => {
        setImg();
    }),
        [info];
    function setImg(event) {
        // setReset((reset + 1) % 2);
        try {
            var file = event.target.files[0];
            var reader = new FileReader();
            reader.onload = function (event) {
                setInfo({
                    ...info,
                    cover_image: event.target.result,
                });
            };

            reader.readAsDataURL(file);
        } catch {}
    }

    return (
        <div className="blog_edit_wrapper">
            <div className="nav_bar_blog_edit">
                <img className="img_logo" />
                <input
                    className="blog_edit_name"
                    placeholder="My Blog Name"
                    value={info.name}
                    onChange={(event) => {
                        setInfo({ ...info, name: event.target.value });
                    }}
                />
                <label for="file-upload" className="custom-file-upload">
                    <img className="ic_img_upload" />
                    Blog Cover
                </label>
                <input
                    id="file-upload"
                    accept="image/*"
                    type="file"
                    style={{ display: "none" }}
                    onChange={setImg}
                />
                <button
                    className="blog_edit_button"
                    onClick={async () => {
                        if (blogId == "") {
                            console.log("create");
                            console.log(info.im);
                            const id = await createBlog(
                                user.email,
                                user.password,
                                info.name,
                                [page],
                                true, //add public
                                "11/02/2022", //add date
                                info.cover_image
                            );
                            setBlogId(id);
                        } else {
                            console.log("save");
                            saveBlog(
                                user.email,
                                user.password,
                                blogId,
                                info.name,
                                [page],
                                true, //add public
                                "11/02/2022",
                                info.cover_image
                            );
                        }
                    }}
                >
                    Save
                </button>
                <Profile name={user.username} url={user.profileImage} />
            </div>
            <img src={info.cover_image} />
            {sectionList}
            <div className="blog_edit_section_break">
                <Popup
                    trigger={
                        <button className="blog_edit_insert_btn">
                            + Interactive Media
                        </button>
                    }
                    position="right center"
                    modal={true}
                    onOpen={() => {
                        setDiagramNameList(user);
                    }}
                >
                    <div className="modal_wrapper">
                        <div className="save_diagram_header">Load Diagram</div>
                        <div className="all_diagram_wrapper">
                            {diagramCompList}
                        </div>
                        <button
                            className="load_diagram_button"
                            onClick={insertComponent}
                        >
                            Load
                        </button>
                    </div>
                </Popup>
                <button className="blog_edit_insert_btn_2" onClick={insertQill}>
                    + Text Editor
                </button>
            </div>

            {/* <div className="blog_edit_section_break">
                
            </div> */}
        </div>
    );
}
